import React, { useState, useEffect } from "react";
import {
  UserIcon,
  Cog6ToothIcon,
  ChartBarIcon,
  DocumentTextIcon,
} from "@heroicons/react/24/outline";

// Example data
const exampleUsers = [
  { id: 1, name: "Alice", role: "admin", status: "active" },
  { id: 2, name: "Bob", role: "user", status: "suspended" },
  { id: 3, name: "Charlie", role: "user", status: "active" },
];

const exampleLogs = [
  { id: 1, action: "User login", timestamp: "2025-08-15 12:30" },
  { id: 2, action: "File upload", timestamp: "2025-08-15 13:00" },
  { id: 3, action: "Error: Missing field", timestamp: "2025-08-15 14:00" },
];

export default function AdminDashboard() {
  const [activeTab, setActiveTab] = useState("overview");
  const [users, setUsers] = useState(exampleUsers);
  const [logs, setLogs] = useState(exampleLogs);

  // Pagination state
  const [userPage, setUserPage] = useState(1);
  const [logPage, setLogPage] = useState(1);
  const pageSize = 5;

  // Search/filter state
  const [searchQuery, setSearchQuery] = useState("");
  const [roleFilter, setRoleFilter] = useState("all");
  const [statusFilter, setStatusFilter] = useState("all");

  // Loading simulation
  const [loading, setLoading] = useState(false);

  const tabIcons = {
    overview: <ChartBarIcon className="w-4 h-4 mr-1" />,
    users: <UserIcon className="w-4 h-4 mr-1" />,
    logs: <DocumentTextIcon className="w-4 h-4 mr-1" />,
    settings: <Cog6ToothIcon className="w-4 h-4 mr-1" />,
  };

  // Filtered users
  const filteredUsers = users.filter((u) => {
    const matchesSearch = u.name.toLowerCase().includes(searchQuery.toLowerCase());
    const matchesRole = roleFilter === "all" || u.role === roleFilter;
    const matchesStatus = statusFilter === "all" || u.status === statusFilter;
    return matchesSearch && matchesRole && matchesStatus;
  });

  const paginatedUsers = filteredUsers.slice((userPage - 1) * pageSize, userPage * pageSize);
  const paginatedLogs = logs.slice((logPage - 1) * pageSize, logPage * pageSize);

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-6">Admin Dashboard</h1>

      {/* Tabs */}
      <div className="tabs flex space-x-3 mb-6 border-b border-gray-200">
        {["overview", "users", "logs", "settings"].map((tab) => (
          <button
            key={tab}
            onClick={() => setActiveTab(tab)}
            className={`px-2 py-1 text-sm font-medium capitalize flex items-center transition-all ${
              activeTab === tab
                ? "border-b-2 border-blue-500 text-blue-600"
                : "text-gray-500 hover:text-gray-800"
            }`}
          >
            {tabIcons[tab]}
            {tab}
          </button>
        ))}
      </div>

      {/* Overview */}
      {activeTab === "overview" && (
        <div>
          <h2 className="text-lg font-semibold mb-4">Quick Stats</h2>
          <div className="grid grid-cols-2 gap-4">
            <div className="p-4 border rounded-lg shadow-sm">
              <p className="text-sm text-gray-600">Total Users</p>
              <p className="text-xl font-bold">{users.length}</p>
            </div>
            <div className="p-4 border rounded-lg shadow-sm">
              <p className="text-sm text-gray-600">Total Logs</p>
              <p className="text-xl font-bold">{logs.length}</p>
            </div>
          </div>
        </div>
      )}

      {/* Users */}
      {activeTab === "users" && (
        <div>
          <h2 className="text-lg font-semibold mb-4">Manage Users</h2>

          {/* Search & Filters */}
          <div className="flex gap-3 mb-4">
            <input
              type="text"
              placeholder="Search users..."
              className="border p-2 rounded w-1/3"
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
            />
            <select
              className="border p-2 rounded"
              value={roleFilter}
              onChange={(e) => setRoleFilter(e.target.value)}
            >
              <option value="all">All Roles</option>
              <option value="admin">Admin</option>
              <option value="user">User</option>
            </select>
            <select
              className="border p-2 rounded"
              value={statusFilter}
              onChange={(e) => setStatusFilter(e.target.value)}
            >
              <option value="all">All Status</option>
              <option value="active">Active</option>
              <option value="suspended">Suspended</option>
            </select>
          </div>

          {/* User List */}
          {loading ? (
            <p className="text-gray-500">Loading users...</p>
          ) : paginatedUsers.length === 0 ? (
            <p className="text-gray-500">No users found.</p>
          ) : (
            <ul className="space-y-2">
              {paginatedUsers.map((user) => (
                <li
                  key={user.id}
                  className="flex justify-between p-3 border rounded-md"
                >
                  <span>
                    {user.name} â€” <span className="text-gray-500">{user.role}</span>
                  </span>
                  <span
                    className={`text-sm px-2 py-1 rounded ${
                      user.status === "active"
                        ? "bg-green-100 text-green-700"
                        : "bg-red-100 text-red-700"
                    }`}
                  >
                    {user.status}
                  </span>
                </li>
              ))}
            </ul>
          )}

          {/* Pagination */}
          <div className="flex justify-between mt-4">
            <button
              disabled={userPage === 1}
              onClick={() => setUserPage(userPage - 1)}
              className="px-3 py-1 border rounded disabled:opacity-50"
            >
              Prev
            </button>
            <button
              disabled={userPage * pageSize >= filteredUsers.length}
              onClick={() => setUserPage(userPage + 1)}
              className="px-3 py-1 border rounded disabled:opacity-50"
            >
              Next
            </button>
          </div>
        </div>
      )}

      {/* Logs */}
      {activeTab === "logs" && (
        <div>
          <h2 className="text-lg font-semibold mb-4">System Activity</h2>
          {loading ? (
            <p className="text-gray-500">Loading logs...</p>
          ) : paginatedLogs.length === 0 ? (
            <p className="text-gray-500">No logs found.</p>
          ) : (
            <ul className="space-y-2">
              {paginatedLogs.map((log) => (
                <li key={log.id} className="p-3 border rounded-md">
                  <p>{log.action}</p>
                  <p className="text-sm text-gray-500">{log.timestamp}</p>
                </li>
              ))}
            </ul>
          )}

          {/* Pagination */}
          <div className="flex justify-between mt-4">
            <button
              disabled={logPage === 1}
              onClick={() => setLogPage(logPage - 1)}
              className="px-3 py-1 border rounded disabled:opacity-50"
            >
              Prev
            </button>
            <button
              disabled={logPage * pageSize >= logs.length}
              onClick={() => setLogPage(logPage + 1)}
              className="px-3 py-1 border rounded disabled:opacity-50"
            >
              Next
            </button>
          </div>
        </div>
      )}

      {/* Settings */}
      {activeTab === "settings" && (
        <div>
          <h2 className="text-lg font-semibold mb-4">Admin Controls</h2>
          <p className="text-gray-600">Settings go here...</p>
        </div>
      )}
    </div>
  );
}
